While away this week I am not tracking food or counting containers. I don’t feel the need to over eat or go “off the rails”. I have zero guilt for enjoying a few drinks or some s’mores around the campfire 🔥
.
I believe in the 80/20 rule, even on vacation! As you will see in my stories, my superfood nutrition shake was still in my daily routine. I would say it’s needed now more than ever as I am adding in extras like cocktail and sweets to keep my body functioning at its best.

I also didn’t skip a workout this week. I did some modifications due to equipment but working out is how I start my day every morning and sticking to my routine works for me.
.
Remember, it’s okay to take a break, have a few treats and most importantly relax! Your body and mind will thank you for it!
