오싹하지만 따뜻한 좀비 이야기 들어 볼래요?

이 작품의 세계관은 독특해요.
좀비와 유령들이 오싹한 분위기를 자아내지만
모르티나와 개성 가득한 캐릭터들이 펼치는
흥미진진한 이야기를 따라가다 보면
어느새 마음이 따뜻해지거든요.
이야기를 읽고 나면 우리는 알게 돼요.
모습이 달라도 진심이 통하면 친구가 될 수 있고,
겉모습으로 섣불리 누군가를 판단해서는 안 된다는 것을 말이지요.
창백한 피부에 탁구공처럼 툭 튀어나온 눈,
다크서클이 드리워진 모르티나의 얼굴만 보고 누가 알았겠어요.
이렇게 용감하고 사랑스러운 좀비 소녀라는 사실을요!

